window.bookSummaryJSON = "<p>Xeal/Alex has once again thwarted the designs of the major workshops and can once again return his attention to the quests that Prince Victor has assigned him. Meanwhile in reality, Abysses End has returned with the next group of their young members and Alex must deal with the issues they cause. All while preparing himself and others to making the push for tier-five and share his, Sam's, and Nicole's news with others.</p>"; 
